import React,{Component} from 'react';
import axios from 'axios';


class Lista extends Component{

    constructor(props){

        super(props);


       this.state = {
        "marcado" : true,
        "vazio" : true,
        "texto" : "asfsaf",
        "_links" : {
          "self" : {
            "href" : "http://localhost:8080/api/todoModels/1"
          },
          "todoModel" : {
            "href" : "http://localhost:8080/api/todoModels/1"
          }
        }
      }       

      /** 

      axios.get('http://localhost:8080/api/todoModels')
        .then(res => {
          const tmodels = res.todoModels;

          alert(tmodels);


         //this.setState({tmodels});
        })

        **/

       this.updateState = this.updateState.bind(this);
       this.keyEnter = this.keyEnter.bind(this);



    }

   updateState = e => {                 



        this.setState({marcado: e.target.value});


   }

   keyEnter = e => {

        if(e.keyCode === 13){

            e.preventDefault();            
         this.setState({marcado:"",items:[...this.state.items,this.state.marcado]})

         }


   }




    render(){

     return (       


        <div>            

             <input 
                        name="lentrada"
                        type="text"
                        value={this.state.entrada}
                        className="form-control"
                        aria-label="Large"
                        onChange={this.updateState}
                        onKeyDown={this.keyEnter}
                        autofocus="true" 
                    />    




      </div> 



     )
    }
}

export default Lista;
